import { View, Text, TouchableOpacity, Image } from 'react-native'

export function NavBar() {
    return (
        <View>
            <View style={{position: 'absolute', bottom: 0, zIndex: 1, width: '100%', height: 83, backgroundColor: '#FFFFFF', borderTopLeftRadius: 12, borderTopRightRadius: 12, shadowColor: "rgba(0, 0, 0, 0.06)", shadowOffset: { width: 0, height: -4 }, shadowRadius: 20, elevation: 20, shadowOpacity: 1}}>
                <TouchableOpacity>
                   <Image source={require('../../../assets/homeNavBar.jpg')} style={{width: 40, height: 35, top: 15, }}></Image> 
                </TouchableOpacity>
            </View>
        </View>
    )
}
